import React from "react";

export default function App() {
  return (
    <div className="bg-gray-100 min-h-screen pt-24">
      {/* Fixed navbar */}
      <nav className="bg-white shadow fixed top-0 w-full z-50">
        <div className="max-w-7xl mx-auto px-4 py-4 flex justify-between items-center">
          <h1 className="text-2xl font-bold">Elev8 Store</h1>
          <span>ðŸ›’ 0 items</span>
        </div>
      </nav>

      {/* Main content container */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <main>
          <h2 className="text-3xl font-bold mb-6 text-center">Our Collection</h2>
          <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
            {[...Array(16)].map((_, i) => (
              <div
                key={i}
                className="bg-white rounded shadow p-4 flex flex-col items-center"
              >
                <img
                  src={`https://source.unsplash.com/400x400/?sneakers&sig=${i}`}
                  alt="shoe"
                  className="h-48 w-full object-cover rounded"
                />
                <h3 className="mt-4 font-semibold">Product {i + 1}</h3>
                <p className="mt-1 text-gray-700">$100.00</p>
              </div>
            ))}
          </div>
        </main>
      </div>
    </div>
  );
}
